import React from 'react';
import { BrowserRouter as Router, Link, Route, Routes } from 'react-router-dom';
import HomeSection from './Landing page/HomeSection';
import AboutSection from './Landing page/AboutSection';
import ContactSection from './Landing page/ContactSection';
import Appbar from './surface/Appbar';

function App() {
  return (
    <Router>
      <Appbar />
      <Routes>
        <Route path="/" element={<HomeSection />} />
        <Route path="/about" element={<AboutSection />} />
        <Route path="/contact" element={<ContactSection />} />
      </Routes>

      {/* Add smooth scrolling links in the Appbar */}
      <nav>
        <ul>
          <li>
            <Link to="#home">Home</Link>
          </li>
          <li>
            <Link to="#about">About</Link>
          </li>
          <li>
            <Link to="#contact">Contact</Link>
          </li>
        </ul>
      </nav>
    </Router>
  );
}

export default App;
